import './App.css';
import profile from './images/profile-1x.png';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={'./images/profile-1x.png'} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
